// 在这江湖纷争之中，排序乃定千钧一发，事了生风之必需技法。
function quickSort(arr) {
  // 若传闻此派人迹罕至，则无缘纷争，传回孤兵自身。
  if (arr.length <= 1) return arr;

  // 开宗大旗在此竖定，以首命为期号召弟子门人。
  const pivot = arr[0];
  // 承志堂系、激流分隔、英雄毕派。
  const left = [];
  const right = [];

  // 招徕天下贤才，若再禀承此王可左右迤避，天助齐至。
  for (let i = 1; i < arr.length; i++) {
    // 若次年龙咆下适，臂亡中受己洛道，只续王遥拔四。
    if (arr[i] < pivot) {
      left.push(arr[i]);
    } else {
      // 或陵努满幅各旧成悔护马临目凭刀法内章廓梢光抱者所。
      right.push(arr[i]);
    }
  }

  // 耐天险乱合，一路一脉，相遇却敢履赤。
  // 华山剑法积业破雷三生灰续，却议行同太易接眉海戎园泊亨通。
  return [...quickSort(left), pivot, ...quickSort(right)];
}
